struct Solver {
    
    int n, MX;
    
    std::vector<bool> win;
    
    Solver(int n_, int MX_ = 300) : n(n_), MX(MX_) { }
    
    void precalc() {
        const int pow[4] = {1,MX,MX*MX,MX*MX*MX};
        win.resize(pow[n]);
        int coeff = 0;
        for (int i = 0; i < n; ++i) {
            coeff += pow[i];
        }
        for (int mask = 1; mask < (int)win.size(); ++mask) {
            int values[4], temp = mask, min = MX;
            for (int bit = 0; bit < n; ++bit) {
                values[bit] = temp % MX;
                temp /= MX;
                min = std::min(min, values[bit]);
            }
            int res = 0;
            for (int bit = 0; !res && bit < n; ++bit) {
                for (int x = values[bit]; !res && x >= 1; --x) {
                    res |= !win[mask - x * pow[bit]];
                }
            }
            for (int x = min; !res && x >= 1; --x) {
                res |= !win[mask - x * coeff];
            }
            win[mask] = res;
        }
    }

    void save_to_file(FILE *file) {
        std::vector<int> diff;
        int last = 0;
        for (int mask = 1; mask < (int)win.size(); ++mask) {
            if (win[mask]) continue;
            int values[4]{}, temp = mask;
            for (int bit = 0; bit < n; ++bit) {
                values[bit] = temp % MX;
                temp /= MX;
            }
            bool flag = false;
            for (int i = 1; !flag && i < n; ++i) {
                if (values[i-1] < values[i]) {
                    flag = true;
                }
            }
            if (flag) continue;
            diff.push_back(mask-last);
            last = mask;
        }
        fprintf(file, "{");
        for (int i = 0; i < (int)diff.size(); ++i) {
            if (i > 0) {
                fprintf(file, ",");
            }
            fprintf(file, "%d", diff[i]);
        }
        fprintf(file,"}\n");
    }
    
    void load(const std::vector<int>& diff) {
        const int pow[4] = {1,MX,MX*MX,MX*MX*MX};
        win.assign(pow[n], true);
        int last = 0; win[0] = false;
        for (auto it : diff) {
            win[last += it] = false;
        }
    }
    
    bool get(int a = 0, int b = 0, int c = 0) const {
        if (n >= 2 && a < b) std::swap(a, b);
        if (n >= 3 && a < c) std::swap(a, c);
        if (n >= 3 && b < c) std::swap(b, c);
        assert(a >= b && b >= c);
        return win[a + MX * b + MX * MX * c];
    }
};

const bool PRECALC = false;

void load1(Solver&);
void load2(Solver&);
void load3(Solver&);

int main() {
    Solver solver1(1), solver2(2), solver3(3);
    if (PRECALC) {
        auto file = fopen("data.txt", "wt");
        solver1.precalc(); solver1.save_to_file(file);
        solver2.precalc(); solver2.save_to_file(file);
        solver3.precalc(); solver3.save_to_file(file);
        fclose(file);
    } else {
        load1(solver1);
        load2(solver2);
        load3(solver3);
    }
    int n;
    while (std::cin >> n) {
        int a = 0, b = 0, c = 0, res = 0;
        if (n == 1) {
            std::cin >> a;
            res = solver1.get(a);
        } else if (n == 2) {
            std::cin >> a >> b;
            res = solver2.get(a,b);
        } else if (n == 3) {
            std::cin >> a >> b >> c;
            res = solver3.get(a,b,c);
        }
        std::cout << (res ? "BitLGM\n" : "BitAryo\n");
    }
    return 0;
}

